import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import Home from './components/Home';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Hello, World!</h1>
          <Switch>
            <Route path="/" exact component={Home} />
          </Switch>
        </header>
      </div>
    </Router>
  );
}

export default App;
